//   };

  return (
    <nav className="navbar">
      <span className="navbar-title">SJSU Club Matching</span>
      <ul>
        <li><button onClick={() => scrollToSection('dashboard')}>Dashboard</button></li>
        <li><button onClick={() => scrollToSection('club-registration')}>Club Registration</button></li>
        <li><button onClick={() => scrollToSection('user-registration')}>User Registration</button></li>
        <li><button onClick={onSurveyButtonClick}>Club Matching Survey</button></li>
      </ul>
    </nav>
  );
};

export default Navigation;
